import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        <nav>
            <Link to="/" style={{ marginLeft: '20px' }}>
                <img src={process.env.PUBLIC_URL + '/images/Home.png'} alt="Home" width={80} height={80}/>
            </Link>
            <span style={{justifyContent: 'center', alignItems: 'center'}}>음악을 사랑하시나요?</span>
        </nav>


    );
};

export default Navbar;
